import {Modal, Button, Card, CardActions, CardContent, Typography, Box} from '@mui/material';

const TeamCard = () => {
    return(
        <Box sx={{ width: 313, height: 241,}}>
            <Card>
                <CardContent>
                    <Typography>
                        This is test text.
                    </Typography>
                </CardContent>
            </Card>
        </Box>
    );

}

export default TeamCard;
